window.bookSummaryJSON = "<p><b>One of the most anticipated autobiographies of this generation, Arnold Schwarzenegger's <i>Total Recall</i> is the candid story of one of the world's most remarkable actors, businessmen, and world leaders. </b> </p> <p>Born in the small city of Thal, Austria, in 1947, Arnold Schwarzenegger moved to Los Angeles at the age of 21. Within 10 years, he was a millionaire businessman. After 20 years, he was the world's biggest movie star. In 2003, he was elected governor of California and became a household name around the world. </p> <p>Chronicling his embodiment of the American Dream, <i>Total Recall</i> covers Schwarzenegger's high-stakes journey to the United States, from creating the international bodybuilding industry out of the sands of Venice Beach, to breathing life into cinema's most iconic characters, and becoming one of the leading political figures of our time. Proud of his accomplishments and honest about his regrets, Schwarzenegger spares nothing in sharing his amazing story.</p>"; 
